// SPDX-License-Identifier: MIT
// Compatible with OpenZeppelin Contracts ^5.0.0
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/access/AccessControl.sol";
import {IRegistrarRegistry} from './IRegistrarRegistry.sol';
import {VectorAddress, LibVectorAddress} from './VectorAddress.sol';
import {IWorld} from './IWorld.sol';
import {World} from './World.sol';

contract WorldRegistry is AccessControl {

    using LibVectorAddress for VectorAddress;

    IRegistrarRegistry public registrarRegistry;
    mapping(address => IWorld) public worldsByContractAddress;
    mapping(string => IWorld) public worldsVectorAddress;
    mapping(string => IWorld) public worldsByName;

    modifier onlyRegistrar(uint256 registrarId) {
        require(registrarRegistry.isRegistrar(registrarId, msg.sender), "World: caller is not the registrar");
        _;
    }

    struct WorldInfo {
        string name;
        VectorAddress baseVector;
        address owner;
        bool tokensToOwner;
    }

    event WorldRegistered(address indexed world, address indexed owner, VectorAddress vectorAddress);

    constructor(IRegistrarRegistry regRegistry, address defaultAdmin) {
        registrarRegistry = regRegistry;
        _grantRole(DEFAULT_ADMIN_ROLE, defaultAdmin);
    }

    function isWorld(address world) public view returns (bool) {
        return address(worldsByContractAddress[world]) != address(0x0);
    }

    function register(uint256 registrarId, WorldInfo calldata info) public payable onlyRegistrar(registrarId) {
        World w = new World(msg.sender, info.name, info.baseVector);
        worldsByContractAddress[address(w)] = IWorld(w);
        worldsVectorAddress[info.baseVector.asLookupKey()] = IWorld(w);
        worldsByName[info.name] = IWorld(w);
        if(msg.value > 0) {
            if(info.tokensToOwner) {
                payable(info.owner).transfer(msg.value);
            } else {
                payable(w).transfer(msg.value);
            }
        }
        emit WorldRegistered(address(w), info.owner, info.baseVector);
    }

}

